import React from "react";
import styled from "styled-components";

const SliderImage = (props) => {
  return (
    <Container>
      <img src={props.imageurl} alt="MyHospitalWebApp" />
      <div className="disc">
        <h1>Description</h1>
        <p>
          Lorem ipsum dolor, sit amet consectetur adipisicing elit. Modi illum
          impedit vitae magni necessitatibus sequi eos fugiat eum sint voluptas
          asperiores tenetur, repellendus amet, provident cum! Accusamus
          corrupti officiis ea!
          <a href="#">Demo</a>
        </p>
      </div>
    </Container>
  );
};

const Container = styled.div`
  height: 10rem;
  background-color: #51609b;
  margin: 0 0 5rem;
  padding: 0 0 5rem;
  border-radius: 5px;
  cursor: pointer;
  position: relative;
  overflow: hidden;
  img {
    width: 100%;
    height: 100%;
    object-fit: cover;
  }
  .disc {
    position: absolute;
    right: 0;
    left: 0;
    bottom: 0;
    text-align: left;
    padding: 0.5rem;
    background: linear-gradient(rgba(0, 0, 0, 0.1), rgba(0, 0, 0, 0.8));
  }
  h1 {
    font-size: 1rem;
  }
  p {
    width: 90%;
    font-size: 0.8rem;
    a {
      margin-left: 0.4rem;
      color: red;
    }
  }
`;
export default SliderImage;
